    const categoryValue = nameInputRef.current.value;

    const item = {
        name: nameValue,
        price: priceValue ,
        category: categoryValue, 
    }
    console.log(item);
    }
  return (
    <form onSubmit={formSubmitHandler}>
      <label>Eseme nimi</label><br />
